                    <label onChange={(event) => ({...user, password: event.target.value})} htmlFor="login-password" >Senha</label>
                    <input id="login-password" placeholder="Senha"/>
                </div>
                <button type="button" onClick={login}>Entrar</button>
              </LoginForm>
